import Directory from "./components/directory/directory";

function App() {
  const categories = [
    {
      id: 1,
      title: "Pijamas",
      imageUrl: "images/uno.jpg",
    },
    {
      id: 2,
      title: "Batas",
      imageUrl: "images/batas.jpg",
    },
    {
      id: 3,
      title: "Cojies",
      imageUrl: "images/uno.jpg",
    },
    {
      id: 4,
      title: "womens",
      imageUrl: "images/uno.jpg",
    },
    {
      id: 5,
      title: "mens",
      imageUrl: "images/uno.jpg",
    },
  ];
  return (
    <div className="categories-container">
      <Directory categories={categories} />
    </div>
  );
}

export default App;
